package uz.coder.mvpexample.mvpinterface Contract {    interface View {        fun showProgress()        fun hideProgress()        fun setString(s:String)    }    interface Model{        interface OnFinishedListener{            fun onFinished(s:String)        }        fun getNextCourse(onFinishedListener: OnFinishedListener)    }    interface Presenter{        fun onButtonClick()        fun onDestroy()    }}